  \"Contaminants in Steller's Eider (Polysticta stelleri) on Alaskan Breeding Grounds
  Near Barrow, Alaska, 1999-2004\",\n\t\"tracking_summary\": {\n\t\t\"total\": 7,\n\t\t\"recent\":
  0\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\":
  \"2016-07-27T22:41:54.188423\",\n\t\"name\": \"contaminants-in-stellers-eider-polysticta-stelleri-on-alaskan-breeding-grounds-near-b-1999\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Steller's eiders (Polysticta stelleri),
  the smallest of the four eider species, spend their entire life cycle in sub-arctic
  and arctic areas. The Pacific population historically bred in Arctic freshwater
  tundra ponds on the northern coastal plains of Alaska and Russia and the brackish
  marshes of the Yukon-Kuskokwim (Y-K) Delta, and wintered in shallow near shore marine
  waters of the Alaska Peninsula. Elevated blood and tissue lead levels, morbidity,
  and mortality from lead poisoning have been documented in spectacled eider (Somateriafischeri)
  (Franson et al. 1995, Flint et al. 1997), common eider (Somateria mollissima) (Franson
  et al. 1995), and possibly in Steller's eider (Flint and Herzog 1999) on breeding
  grounds in the Y-K Delta. Other contaminants may also affect Steller's eiders, including
  heavy metals, trace elements, and persistent organic pollutants such as organochlorine
  pesticides and polychlorinated biphenyls (PCBs). The study objectives were to document
  and evaluate lead, other metal, and persistent organochlorine concentrations in
  Steller's eider blood, tissue, and addled eggs from the only known breeding concentration
  in the United States, at Barrow, Alaska.\",\n\t\"license_title\": \"License Not
